import { IonList, IonItem } from "@ionic/react";
import "./DetailsList.css";
import Course from "../models/Course";

interface PrerequisiteCoursesListProps {
  prerequisiteCourses: Course[];
}

interface PrerequisitesForListProps {
  prerequisitesFor: Course[];
}

const PrerequisiteCoursesList: React.FC<PrerequisiteCoursesListProps> = ({ prerequisiteCourses }) => {
  return (
    <IonList>
      {prerequisiteCourses.length === 0 ? (
        <IonItem key="0">{"None"}</IonItem>
      ) : (
        prerequisiteCourses.map((course, index) => {
          return <IonItem key={index}>{`${course.CourseCode} - ${course.Title}`}</IonItem>;
        })
      )}
    </IonList>
  );
};

const PrerequisitesForList: React.FC<PrerequisitesForListProps> = ({ prerequisitesFor }) => {
  return (
    <IonList>
      {prerequisitesFor.length === 0 ? (
        <IonItem key="0">{"None"}</IonItem>
      ) : (
        prerequisitesFor.map((course, index) => {
          return <IonItem key={index}>{`${course.CourseCode} - ${course.Title}`}</IonItem>;
        })
      )}
    </IonList>
  );
};

export { PrerequisiteCoursesList, PrerequisitesForList };
